		"text": "@robotsneedpoems @NeuroYogacara @MikeBenchCapon @carl_b_sachs Our brains are tuned up to be sensitive to certain patterns in the stuff around us and to react to them in distinctive ways. They are also tuned up to be sensitive to their own sensitivities and reactive dispositions.  Properly filled out, that's the *whole* picture."
